// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

interface OracleInterface{
  function bankAccountLiquidityCheck(address _wallet, string memory _bankAccount) external view returns(bool);
}

contract EurCA {

  OracleInterface private oracle;
  uint256 eurekaTokenQuantity;

  struct Wallet{
    string bankAccount;
    uint256 lockedLiquidity;
    uint256 tokenEurekaMinted;
    uint256 missingInstallments;
    uint256 totalInterestRate;
  }

  mapping (address => Wallet) public wallets;

  uint256 public constant maxUnpaidInstallments = 3;

  constructor(address _oracleAddress) {
    oracle = OracleInterface(_oracleAddress);
  }

  function linkBankAccount(string memory _bankAccount) external{
    require(bytes(wallets[msg.sender].bankAccount).length == 0, "Bank account already linked to a wallet.");
    bool isLiquidityVerified = oracle.bankAccountLiquidityCheck(msg.sender, _bankAccount);

    require(isLiquidityVerified, "Bank account's liquidity is not enough.");
    wallets[msg.sender].bankAccount = _bankAccount;
  }

  function lockLiquidity(uint256 _capital) external{
    require(bytes(wallets[msg.sender].bankAccount).length != 0, "Bank account is not linked to any wallet.");
    wallets[msg.sender].lockedLiquidity = _capital;

    // Quantity of Eureka minted with a 90% ot the locked liquidity plus 2,4% of total interest.
    eurekaTokenQuantity = (wallets[msg.sender].lockedLiquidity * 90) / 100 + (wallets[msg.sender].lockedLiquidity * 24) / 1000;
  }

  function paybackRate(uint256 _rate) external{
    require(bytes(wallets[msg.sender].bankAccount).length != 0, "Bank account is not linked to any wallet.");

    wallets[msg.sender].lockedLiquidity -= _rate;
    eurekaTokenQuantity -= _rate;
  }

}
